import React, { useState } from 'react'

export default function App() {
  const [count,setcount] = useState(0)
  const [number,setNumber] = useState(0)
  const increment=()=>{
    setcount(count+1)
  }
  const decrement =()=>{
    setNumber(number - 1)
  }

  return (
    <div>
      <h1>{count}</h1>
      <button onClick={increment}>Count</button>
      <h1>{number}</h1>
      <button onClick={decrement}>Number</button>
    </div>
  )
}
